	add("spearhead", "{\"term\":\"spearhead\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"spear + head\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The pointed head, or end, of a spear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Orion hit a rabbit once; but though sore wounded it got to the bury, and, struggling in, the arrow caught the side of the hole and was drawn out.. Ikey the blacksmith had forged us a \u0027\u0027spearhead\u0027\u0027 after a sketch from a picture of a Greek warrior; and a rake-handle served as a shaft\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who leads or initiates an activity (such as an attack or a campaign\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The leading military unit in an attack\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A player who initiates attacking moves\", \"priority\":5}]}, \"synonyms\":{}}");

