	add("spearwood", "{\"term\":\"spearwood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|spear|wood|lang\u003den}}; named for the use made of the wood by Australian Aborigines to make spear shafts.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The erect woody evergreen shrub , endemic to Western Australia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1966\u0027\u0027, Western Australian Forests Department, \u0027Bulletin\u0027, Issues 63-77, %22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22spearwood%22|%22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003duGlyeK75R3\u0026amp;sig\u003dMOdfTbG5p6rjD2UDr98PNoJ0Sao\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNlVcUO6qM8mSiAfE74CIDw\u0026amp;redir_esc\u003dy page 62\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Peppermint (\u0027Agonis flexuosa\u0027), attaining heights of up to 30 feet, is the principal understorey species in the south, while \u0027Banksia menziesii\u0027, \u0027Banksia grandis\u0027, \u0027Banksia attenuata\u0027, \u0027Casuarina fraseriana\u0027, black wattle and \u0027\u0027spearwood\u0027\u0027 (\u0027Kunzea ericifolia\u0027) predominate in the north\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Noel Hoffman, Andrew Brown, \u0027Orchids of South-West Australia\u0027, %22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22spearwood%22|%22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dx6rRTG1-bn\u0026amp;sig\u003d10cwlVILkCFjSrz6Sb0PlykFMb8\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNlVcUO6qM8mSiAfE74CIDw\u0026amp;redir_esc\u003dy page 201\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In these areas it is found usually under \u0027\u0027Spearwood\u0027\u0027, \u0027Kunzea ericifolia\u0027 in low-lying situations adjoining winter-wet swamps\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The shrub\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Society for Growing Australian Plants, \u0027Australian Plants\u0027, Volume 9, Issue 69 - Volume 10, Issue 84, %22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22spearwood%22|%22spearwoods%22+kunzea+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d0Q4g0sp9D_\u0026amp;sig\u003d3URzZoHh_huB7sRZ24CZIlYVODg\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dNlVcUO6qM8mSiAfE74CIDw\u0026amp;redir_esc\u003dy page 379\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Clinging to the sparse soil beneath the trees are the hardy acacias ‚Äî \u0027\u0027Spearwood\u0027\u0027 (\u0027Acacia doratoxylon\u0027), with its long, narrow leaves (up to 10cm long by 2-5mm wide), a tall shrub with golden-yellow flower spikes to 2cm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The flowering vine\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The eucalypt\", \"priority\":10}]}, \"synonyms\":{}}");

	add("specialization", "{\"term\":\"specialization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|specialize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of specializing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, q:Robert A. Heinlei\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Time Enough For Love Robert A. Heinlein, \u0027\u0027Time Enough For Love\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A human being should be able to change a diaper, plan an invasion, butcher a hog, conn a ship, design a building, write a sonnet, balance accounts, build a wall, set a bone, comfort the dying, take orders, give orders, cooperate, act alone, solve equations, analyze a new problem, pitch manure, program a computer, cook a tasty meal, fight efficiently, die gallantly. \u0027\u0027Specialization\u0027\u0027 is for insects\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The act or process becoming specialized\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The adaptation of an organism to a specific environment, or adaptation of an organ to a particular function\", \"priority\":6}]}, \"synonyms\":{}}");

