	add("specialty", "{\"term\":\"specialty\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027specialte\u0027 \u0027especialte\u0027 from Latin \u0027specialitas\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That in which one specializes; a chosen expertise or talent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"They cook well overall, but their true \u0027\u0027specialty\u0027\u0027 is pasta\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Charles Kingsley\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Men of boundless knowledge, like Humbold, must have had once their \u0027\u0027specialty\u0027\u0027, their pet subject\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"particularit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Specialty\u0027\u0027 of rule hath been neglected\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A particular or peculiar case\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An attribute or quality peculiar to a species\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A contract or obligation under seal; a contract by deed; a writing, under seal, given as security for a debt particularly specified\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Let \u0027\u0027specialties\u0027\u0027 be therefore drawn between us\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Joseph Chitt\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"in a plea to an action of debt on \u0027\u0027\u0027specialty\u0027\u0027\u0027\u0026lt;!--sic italics--\u0026gt;, it is still necessary to show that the debt on which the judgment was recovered was a speciality, or to aver that the judgment was recovered before the defendant had notice of the plaintiff\u0027s demand\", \"priority\":14}]}, \"synonyms\":{}}");

	add("species", "{\"term\":\"species\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027speciƒìs\u0027 (appearance; quality) from \u0027speci≈ç\u0027 (see) + \u0027-iƒìs\u0027 suffix signifying abstract noun.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type or kind of thing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1826-1897\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"What is called spiritualism should, I think, be called a mental \u0027\u0027species\u0027\u0027 of materialism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A group of plants or animals having similar appearance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/bookshelf/pub/a-drier-and-hotter-future A Drier and Hotter passage\u003dPhoenix and Lubbock are both caught in severe drought, and it is going to get much worse. We may see many such [dust] storms in the decades ahead, along with \u0027\u0027species\u0027\u0027 extinctions, radical disturbance of ecosystems, and intensified social conflict over land and water. Welcome to the Anthropocene, the epoch when humans have become a major geological and climatic force\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A rank in the classification of organisms, below genus and above subspecies; a taxon at that rank\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Hence, in determining whether a form should be ranked as a \u0027\u0027species\u0027\u0027 or a variety, the opinion of naturalists having sound judgment and wide experience seems the only guide to follow\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Firstly, I continue to base most \u0027\u0027species\u0027\u0027 treatments on personally collected material, rather than on herbarium plants\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dPlant breeding is always a numbers game.The wild \u0027\u0027species\u0027\u0027 we use are rich in genetic variation, and individual plants are highly heterozygous and do not breed true. In addition, we are looking for rare alleles, so the more plants we try, the better\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A mineral with a unique chemical formula whose crystals belong to a unique crystallographic system\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An image, an appearance, a spectacle\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The image of something cast on a surface, or reflected from a surface, or refracted through a lens or telescope; a reflection\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Visible or perceptible presentation; appearance; something perceived\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Wit,the faculty of imagination in the writer, which searches over all the memory for the \u0027\u0027species\u0027\u0027 or ideas of those things which it designs to represent\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1642-1727\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027species\u0027\u0027 of the letters illuminated with indigo and viole\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A public spectacle or exhibition\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Either of the two elements of the Eucharist after they have been consecrated, so named because they retain the image of the bread and wine before their transubstantiation into the body and blood of Christ\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Coin, or coined silver, gold, or other metal, used as a circulating medium; specie\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"1667-1735\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"There was, in the splendour of the Roman empire, a less quantity of current \u0027\u0027species\u0027\u0027 in Europe than there is now\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A component part of compound medicine; a simple\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"An officinal mixture or compound powder of any kind; especially, one used for making an aromatic tea or tisane; a tea mixture\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"1785-1859\", \"priority\":25}]}, \"synonyms\":{}}");

