	add("spectation", "{\"term\":\"spectation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027spectatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Regard; aspect; appearance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"This simple \u0027\u0027spectation\u0027\u0027 of the lungs is differenced from that which concomitates a pleurisy.\u0027 \u0026amp;mdash; Harvey\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of watching something; observation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, \u0027Infinite Jest\u0027, Abacus 2013, p. 34\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the medical attach√© is permitted to ease effortlessly from unwound \u0027\u0027spectation\u0027\u0027 into a fully relaxed night\u0027s sleep, still right there in the recumbent recliner\", \"priority\":5}]}, \"synonyms\":{}}");

