	add("spectre", "{\"term\":\"spectre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027spectre\u0027 from Latin \u0027spectrum\u0027 (appearance, apparition)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027spectre\u0027\u0027 is a ghost of a decapitated young man\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Charlotte Bront√´, \u0027Shirley\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"To this extenuated \u0027\u0027spectre\u0027\u0027, perhaps, a crumb is not thrown once a year, but when ahungered and athirst to famine‚Äîwhen all humanity has forgotten the dying tenant of a decaying house‚ÄîDivine Mercy remembers the mourner\", \"priority\":3}]}, \"synonyms\":{}}");

