	add("spectrum", "{\"term\":\"spectrum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027spectrum\u0027 (appearance, image, apparition) from \u0027speci≈ç\u0027 (look at, view) (see scope)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Specter, apparition\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A range; a continuous, infinite, one-dimensional set, possibly bounded by extremes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Specifically, a range of colours representing light (electromagnetic radiation) of contiguous frequencies; hence electromagnetic spectrum, visible spectrum, ultraviolet spectrum, etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027 October 30, Jim Giles, \u0027Jammed!\u0027, in \u0027w:New New Scientist\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Current 3G technologies can send roughly 1 bit of data - a one or a zero - per second over each 1 Hz of \u0027\u0027spectrum\u0027\u0027 that the operator owns\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The autism spectrum\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The pattern of absorption or emission of radiation produced by a substance when subjected to energy (radiation, heat, electricity, etc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The set of eigenvalues of a matrix\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Of a bounded linear operator \u0027A\u0027, the set of scalar values Œª such that the operator \u0027A‚ÄîŒªI\u0027, where \u0027I\u0027 denotes the identity operator, does not have a bounded inverse; intended as a generalisation of the linear algebra sense\", \"priority\":9}]}, \"synonyms\":{}}");

	add("speculation", "{\"term\":\"speculation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027speculation\u0027 (French: \u0027sp√©culation\u0027 , from \u0027speculƒÅti≈çnem\u0027 from Latin \u0027speculƒÅti≈ç\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of thinking or meditating on a subject\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thenceforth to \u0027\u0027speculations\u0027\u0027 high or deep I turned my thoughts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Caroline Davies, \u0027Duke and Duchess of Cambridge announce they are expecting first baby\u0027 (in \u0027The Guardian\u0027, 3 December 2012)[http://www.guardian.co.uk/uk/2012/dec/03/duke-and-duchess-of-cambridge-expecting-baby?intcmp\u003d122\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Duke and Duchess of Cambridge have ended months of intense \u0027\u0027speculation\u0027\u0027 by announcing they are expecting their first child, but were forced to share their news earlier than hoped because of the Duchess\u0027s admission to hospital on Monday\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act or process of reasoning a priori from premises given or assumed\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A conclusion to which the mind comes by speculating; mere theory; notion; conjecture\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sir W. Templ\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"From him Socrates derived the principles of morality, and most part of his natural \u0027\u0027speculations\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"To his \u0027\u0027speculations\u0027\u0027 on these subjects he gave the lofty name of the \u0026quot;Oracles of Reason\u0026quot\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An investment involving higher-than-normal risk in order to obtain a higher-than-normal return\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The act or practice of buying land, goods, shares, etc., in expectation of selling at a higher price, or of selling with the expectation of repurchasing at a lower price; a trading on anticipated fluctuations in price, as distinguished from trading in which the profit expected is the difference between the retail and wholesale prices, or the difference of price in different markets\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A. Smit\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Sudden fortunes, indeed, are sometimes made in such places, by what is called the trade of \u0027\u0027speculation\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"F. A. Walke\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Speculation\u0027\u0027, while confined within moderate limits, is the agent for equalizing supply and demand, and rendering the fluctuations of price less sudden and abrupt than they would otherwise be\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Examination by the eye; view\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Power of sight\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Thou hast no \u0027\u0027speculation\u0027\u0027 in those eyes\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A card game in which the players buy from one another trumps or whole hands, upon a chance of getting the highest trump dealt, which entitles the holder to the pool of stakes\", \"priority\":22}]}, \"synonyms\":{}}");

