	add("speculum", "{\"term\":\"speculum\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027speculum\u0027 (mirror) diminutive form from root \u0027spec-\u0027, to look at + diminutive suffix \u0027-ulum\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medical instrument used during an examination to dilate an orifice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mirror, especially one used in a telescope\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bright, lustrous patch of colour found on the wings of ducks and some other birds, usually situated on the distal portions of the secondary quills, and much more brilliant in the adult male than in the female\", \"priority\":3}]}, \"synonyms\":{}}");

	add("speech", "{\"term\":\"speech\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027speche\u0027 from Old english (ca. 450-1100) {{m|ang|sc\u003dLatinx|sp«£ƒã}}, {{m|ang|sc\u003dLatinx|spr«£ƒã||speech, discourse, language}}, from Proto-germanic {{m|gem-pro|*sprƒìkij≈ç}}, {{m|gem-pro|*sprƒìk≈ç||speech, language}}, from Proto-indo-european {{m|ine-pro|*spereg-}}, {{m|ine-pro|*spreg-||to make a sound}}. Cognate with Dutch \u0027spraak\u0027 (speech) German \u0027sprache\u0027 (language, speech) More at {{l|en|speak}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The faculty of uttering articulate sounds or words; the ability to speak or to use vocalizations to communicate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dAll this was extraordinarily distasteful to Churchill. It was ugly, gross. Never before had he felt such repulsion when the vicar displayed his characteristic bluntness or coarseness of \u0027\u0027speech\u0027\u0027. In the present connexion\u0026amp;nbsp;[\u0026amp;hellip;] such talk had been distressingly out of place\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A session of speaking; a long oral message given publicly usually by one person\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1667‚Äì1745\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The constant design of these orators, in all their \u0027\u0027speeches\u0027\u0027, was to drive some one particular point\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A style of speaking\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21601233-exploring-link-between-manganese-and-parkinsons-disease-subtle-effects Subtle passage\u003dManganism has been known about since the 19th century, when miners exposed to ores containing manganese, a silvery metal, began to totter, slur their \u0027\u0027speech\u0027\u0027 and behave like someone inebriated\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A dialect or language\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Bible, iii\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"people of a strange \u0027\u0027speech\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Talk; mention; rumour\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The dukedid of me demand / What was the \u0027\u0027speech\u0027\u0027 among the Londoners / Concerning the French journey\", \"priority\":13}]}, \"synonyms\":{}}");

