	add("speedrun", "{\"term\":\"speedrun\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|speed|run|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A playthrough of a computer or video game in which the whole game or a select part of it, such as a single level, is played with the intent of completing it as quickly as possible, optionally with certain prerequisites\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In the \u0027\u0027speedrun\u0027\u0027 of w:Super Mario Bros. Super Mario Bros. 3, Anonymous Jones finishes the whole video game in just 11 minutes\", \"priority\":2}]}, \"synonyms\":{}}");

