	add("spendocrat", "{\"term\":\"spendocrat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027spend\u0027 + \u0027-o-\u0027 + \u0027-crat\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A politician or bureaucrat viewed as supporting excessive spending\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, Martin Dies, \u0027Martin Dies\u0027 Story\u0027, Bookmailer (1963), [http://books.google.com/books?id\u003dBEl3AAAAMAAJ\u0026amp;q\u003d%22spendocrats%22 page 17\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"While Washington \u0026quot;\u0027\u0027spendocrats\u0027\u0027,\u0026quot; of both parties, have spent and wasted more than 100 billion dollars in so-called foreign aid\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, \u0027Telephone Engineer \u0026amp; Management\u0027, Volume 67, [http://books.google.com/books?id\u003d7TU7AAAAMAAJ\u0026amp;q\u003d%22spendocrats%22 page 47\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Not AT\u0026amp;T, nor even our governmental \u0027\u0027spendocrats\u0027\u0027, can afford to toss satellites into space indefinitely and write them off when a faulty transistor or a coy contact puts them out of commission\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, James Liberty, \u0027F. R. E. E. D. O. M.: Essays on America\u0027s Fight for Freedom\u0027, iUniverse (2012), ISBN 9781475937657, [http://books.google.com/books?id\u003dBNhQodB3M-AC\u0026amp;pg\u003dPA38\u0026amp;dq\u003d%22spendocrats%22 page 38\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Spendocrats\u0027\u0027, I mean Democrats, are willing to pass bills that will cause economic hardship just so that they can show their base that they did it ‚Äî pandering for votes\", \"priority\":7}]}, \"synonyms\":{}}");

	add("spendthrift", "{\"term\":\"spendthrift\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who spends money improvidently or wastefully\", \"priority\":1}]}, \"synonyms\":{}}");

	add("sperg", "{\"term\":\"sperg\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of \u0027asperger\u0027s\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Aspergerian: a person with Asperger\u0027s syndrome\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0026quot;Playa\u0026quot;, \u0027re: games workshop staff\u0027 (on newsgroup \u0027rec.games.miniatures.warhammer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"No, \u0027\u0027spergs\u0027\u0027 are compulsively self-absorbed and narcissistic. Any naysayers, if acknowledged at all, would simply be labelled \u0026quot;wrong\u0026quot;. You see, lesser mammals are not worthy of debate, and we\u0027re ALL \u0026quot;lesser\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("sperm", "{\"term\":\"sperm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027sperme\u0027 from Latin \u0027sperma\u0027 () from Ancient greek (to 1453) \u0027œÉœÄŒ≠œÅŒºŒ±\u0027 (seed, semen)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Semen; the generative substance of male animals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Other Nations there are, that never have use of fire; Others, whose \u0027\u0027sperme\u0027\u0027 is of a blacke colour\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The reproductive cell or gamete of the male; a spermatozoon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Sarah Whitehouse, \u0027The Guardian\u0027, 13 Apr 2012\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Seeing the two little moving cells ‚Äì the result of her egg and Luke\u0027s \u0027\u0027sperm\u0027\u0027 ‚Äì was incredible, and two very long weeks later the clinic confirmed I was pregnant\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"sperm Sperm oil; whale oil from a sperm whale; spermaceti\", \"priority\":7}]}, \"synonyms\":{}}");

